import '../css/styleStudy.css'


const Matching = () => {
    return ( 
        <section className="functionality">

        <h1>INSERT TINDER RIP-OFF HERE</h1>
        <p>This application has multiple functions. These functions are all designed to help UCF students or faculty learn information about different majors offered at UCF, find different study groups on campus, and learn about their campus and its students. Each of these different functions can be found at the navigation menu at the top of the page or by clicking them here.</p>

        <div className="row">
            <div className="functionality-0-but"></div>
            <div className="functionality-col">
                <h3>STUDY GROUP EXAMPLE</h3>
                <p><br /><br /><br /><br />This section will contain the following:<br /><br/>Group Location<br/>Group Major<br/>Group Location Image</p>
            </div>
            <div className="functionality-1-but"></div>
        </div>

    </section>
     );
}
 
export default Matching;
